import React, { Component } from "react";
import "./List.css";
export default class List extends Component {
  states = { journal: [] };

  render() {
    return (
      <div>
        <h1>Journals</h1>
        <ol class="gradient-list">
          <li>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</li>
          <li>
            Aenean tincidunt elit at ipsum cursus, vitae interdum nulla
            suscipit.
          </li>
          <li>Curabitur in orci vel risus facilisis accumsan.</li>
          <li>
            Morbi eleifend tortor lacinia sapien sagittis, quis pellentesque
            felis egestas.
          </li>
        </ol>
      </div>
    );
  }
}
